CREATE TABLE categorias (
    cat_id INT AUTO_INCREMENT PRIMARY KEY,
    nombre VARCHAR(50) NOT NULL
);

-- Table for "productos"
CREATE TABLE productos (
    prd_id INT AUTO_INCREMENT PRIMARY KEY,
    prd_nombre VARCHAR(50) NOT NULL,
    prd_descripcion VARCHAR(200) NOT NULL,
    prd_precio DECIMAL(6, 2) NOT NULL,
    prd_imagen LONGBLOB NOT NULL,
    prd_estado CHAR(3) NOT NULL,
    cat_id INT,
    FOREIGN KEY (cat_id) REFERENCES categorias(cat_id)
);

